import { getForecast } from "../../services/API.js";

export default function PointForecast({ latitude, longitude }) {

    const [forecast, setForecast] = useState([]);

    useEffect(() => {
        const body = {
            longitude: longitude,
            latitude: latitude
        }

        getForecast(body).then((response) => {
            console.log(response.data.hours);
            setForecast(response.data.hours);
        }).catch((error) => {
            console.log(error);
        });
    }, []);

